import { memo, useCallback } from 'react';

const Form = memo(({ onSubmit, ...props }) => {
  const handleSubmit = useCallback(
    (e) => {
      if (onSubmit) {
        e.preventDefault();

        onSubmit(e);
      }
    },
    [onSubmit]
  );

  return (
    <form action="src/components/oldComponents/Form#" onSubmit={handleSubmit} className="form" {...props}>
      {props.children}
    </form>
  );
});

export default Form;
